import { Component, OnInit } from '@angular/core';
import { Employee } from './employee.componet';
import { EmployeeServiceService } from './employee-service.service';
import { DataServiceService } from './data-service.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit {
  title = 'Employee list';

  constructor(private myService:EmployeeServiceService, private employeeService:DataServiceService) {
    //this.employees = this.employeeService.employees;

  }

  ngOnInit(): void {
    this.employees = this.employeeService.employees;
  }

  employees: Employee[]=[];

  /*employees: Employee[]=[

    new Employee("Juan","Acevedo","Fullstack", 1500000),
    new Employee("Carlos","Perez","Backend", 1300000),
    new Employee("Andrea","Duarte","Fullstack", 1500000),
    new Employee("Laura","Diaz","Frontend", 1400000),
  ];*/

  AddEmployee(){
    let myEmployee = new Employee(this.nameSpace, this.surnameSpace, this.chargeSpace, this.salarySpace);
    //this.myService.ShowMessage("EmployeeName: " + myEmployee.name + " " + myEmployee.surname)
    //this.employees.push(myEmployee);
    //this.employees = [ ...this.employees, myEmployee ];
    this.employeeService.addEmployeeService(myEmployee);

  };

  nameSpace:string = "";
  surnameSpace:string = "";
  chargeSpace:string = "";
  salarySpace:number = 0;


}
<nav class="navbar navbar-expand-lg navbar-light bg-light">
  <a class="navbar-brand" href="#">Navbar</a>
  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavDropdown" aria-controls="navbarNavDropdown" aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>
  <div class="collapse navbar-collapse" id="navbarNavDropdown">
    <ul class="navbar-nav">
      <li class="nav-item active">
        <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Features</a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Pricing</a>
      </li>
      <li class="nav-item dropdown">
        <a class="nav-link dropdown-toggle" href="#" role="button" data-toggle="dropdown" aria-expanded="false">
          Dropdown link
        </a>
        <div class="dropdown-menu">
          <a class="dropdown-item" href="#">Action</a>
          <a class="dropdown-item" href="#">Another action</a>
          <a class="dropdown-item" href="#">Something else here</a>
        </div>
      </li>
    </ul>
  </div>
</nav>

<div class="container">
  <div class="col">
    <h1 style="text-align: center;">{{title}}</h1> 

    <br>

    <Form class="form-group row">
      <div class="form-group col-md-3">
        <label for="name">Name:</label><br>
        <input type="text" name="name" id="name" placeholder="Name" class="form-control" [(ngModel)]="nameSpace">
      </div>

      <div class="form-group col-md-3">
        <label for="surname">Surname:</label><br>
        <input type="text" name="surname" id="surname" placeholder="Surname" class="form-control" [(ngModel)]="surnameSpace">
      </div>

      <div class="form-group col-md-3">
        <label for="charge">Charge:</label><br>
        <input type="text" name="charge" id="charge" placeholder="Charge" class="form-control" [(ngModel)]="chargeSpace">
      </div>

      <div class="form-group col-md-3">
        <label>Salary:</label><br>
        <input type="number" name="salary" id="salary" placeholder="Salary" class="form-control" [(ngModel)]="salarySpace">
      </div>

      <div class="col">
        <button type="submit" class="btn btn-primary" (click)="AddEmployee()" style="margin-top: 20px;">Add</button>
      </div>

    </Form>
  </div>
</div>

<br/><br/>

<app-employee-son-c *ngFor="let employee of employees; let i = index" [employee]="employee" [i]="i"></app-employee-son-c>
